import React from "react";
import { Container, Row, CardFooter, Card, CardHeader  } from "shards-react";
import Dai from "../pages/static/asset.svg"
import InterestCard from "./cards/InterestCard.js"
import PoolCard from "./cards/PoolCard.js"
import AssetCard from "./cards/AssetCard.js"
import ProposalCard from "./cards/ProposalCards.js"
import CompleteSaleTable from "./tables/CompletedSale.js"



export default class PoolTraker extends React.Component {

  constructor(){
    super();
    this.state = {
      chartData:{}
    }
  }

  render() {
    return (      
            <Container fluid>  
              <Row> 
                <InterestCard />
                <PoolCard />
                <AssetCard />
              </Row>

              <Row>
              <ProposalCard />
                <PoolCard />
                <AssetCard />
                <CompleteSaleTable />
              </Row>
            </Container>
    );
  }
}
